    address owner;

    constructor(){
        owner = msg.sender;
    }

    struct User{
        address walletAddress;
        string name;
        uint amount;
        bool isInvestor;
    }

    modifier onlyOwner(){
        require(msg.sender == owner, "You are not the owner");
        _;
    }

